import Grid from "@material-ui/core/Grid";
import TechBullets from "./TechBullets";
function TechColumns(prop) {
  return (
    <div className="tech_colurmns">
      <h1>Languages</h1>
      <Grid container spacing={3}>
        <Grid item xs={12} lg={6}>
          <TechBullets />
        </Grid>
        <Grid item xs={12} lg={6}>
          <TechBullets />
        </Grid>
      </Grid>
    </div>
  );
}

export default TechColumns;
